}
function SkillGraph () {
    return(
        <GraphContainer>
            <svg>
                <circle cx='50' cy='50' r='50'></circle>
                <circle cx='50' cy='50' r='50'></circle>
            </svg>
        </GraphContainer>
    )
}

function MySkill() {
    return (
        <MySkillContainer>
            <H2>My Skills</H2>
            <SkillGraph></SkillGraph>
        </MySkillContainer>
    )
}

export default MySkill;
